import React from 'react'

export default function Addlist(props) {
  return (
    props.prticp.filter((etm)=>{
       return etm.idCourse===props.affch
      }).map((ex,id)=>{
       return <tr key={id}>
       <td>{ex.id}</td>
       <td>{ex.nom}</td>
       <td>{ex.idCourse}</td></tr> 
      }) 
   
  )
}
